import React, {PureComponent} from 'react'

class Button extends PureComponent {

    render() {

        const {_Function, product, files, title, divStyle} = this.props

        return (
            <div style={divStyle}>
                <button style={{
                    border: 'none', backgroundColor:'rgba(244, 132, 33, 1', 
                    padding: 5, paddingLeft: 15, paddingRight: 15, 
                    width: 150,
                    borderRadius: 25, marginBottom: 10, marginTop: 10,
                }} onClick={() => _Function()}>{title}</button>    
            </div> 
        )
    }
}



export default Button
